INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(12, 'E.T. l\'extra-terrestre', 'Fantascienza', 'Steven Spielberg', 1982, 'Un bambino fa amicizia con un alieno smarrito e cerca di aiutarlo a tornare a casa, evitando che venga catturato dagli adulti.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/pAAo4yzTNlc');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(14, 'La storia infinita', 'Fantasy', 'Wolfgang Petersen', 1984, 'Bastian, un ragazzo solitario, scopre un libro magico che lo trasporta in un mondo fantastico, dove diventa parte della storia stessa.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/7d-lD5eUV-c');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(15, 'I Goonies', 'Avventura', 'Richard Donner', 1985, 'Un gruppo di ragazzini trova una mappa del tesoro e si imbarca in una pericolosa avventura per salvare il loro quartiere dalla demolizione.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/kFj1KG_juuY');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(16, 'La fabbrica di cioccolato', 'Fantasy', 'Tim Burton', 2005, 'Charlie, un ragazzo povero, vince un biglietto per visitare la misteriosa fabbrica di cioccolato del bizzarro Willy Wonka.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/2CA9C3QDkEo');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(17, 'Mamma, ho perso l\'aereo', 'Commedia', 'Chris Columbus', 1990, 'Kevin, un bambino di 8 anni, viene accidentalmente lasciato a casa da solo per Natale e deve difendere la sua casa da due maldestri ladri.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/zac_fjbFaPE');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(18, 'Spy Kids', 'Azione', 'Robert Rodriguez', 2001, 'Due bambini scoprono che i loro genitori sono spie e vengono coinvolti in una missione per salvare il mondo.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/8hjhUzDUeJs');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(19, 'Hugo Cabret', 'Martin Scorsese', 'Avventura', 2011, 'Hugo, un orfano che vive in una stazione di Parigi, scopre un misterioso automa che lo porta a svelare segreti legati al cinema.\r\n', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/n-diOfyOBJk');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(20, 'Il gigante di ferro', 'Animazione', 'Brad Bird', 1999, 'Un ragazzo fa amicizia con un gigante robot alieno e lo protegge dalle autorità che lo vedono come una minaccia.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/B5E1ciHCWBk');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(21, 'IT', 'Horror', 'Andy Muschietti ', 2017, 'Un gruppo di ragazzi affronta le loro paure più profonde, impersonate da un\'entità malvagia che assume la forma di un clown chiamato Pennywise.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/A1x1s__vlKU');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(22, 'Stand by Me - Ricordo di un\'estate', 'Drammatico', 'Rob Reiner', 1986, 'Quattro amici intraprendono un viaggio alla ricerca del corpo di un ragazzo scomparso, scoprendo molto su loro stessi durante il tragitto.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/Ao9AI1pLeG0');
INSERT INTO `films` (`id`, `titolo`, `genere`, `regista`, `anno_uscita`, `sinossi`, `locandina`, `trailer`) VALUES
(23, 'Le cronache di Narnia: Il leone, la strega e l\'armadio', 'Fantasy', 'Andrew Adamson', 2005, 'Quattro fratelli trovano un armadio magico che li trasporta nel mondo di Narnia, dove devono unirsi al leone Aslan per liberare il regno dal gelido dominio della Strega Bianca.', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/YtpOBePjqk8');
